script: |
  super -f text -I q1925.spq | sort > q1925.out

inputs:
  - name: q1925.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + col1 NOT IN ( col1 / col1 + tab1.col1 * + col2 - col1 );
  - name: tab1

outputs:
  - name: q1925.out
    data: |
      3	26	54
      64	10	57
      80	13	96
